import React, {useState} from 'react'
import ExpenseItem from './ExpenseItem';
import ExpensesFilter from './ExpensesFilter';
import Card from '../UI/Card';

import "./Expenses.css";

const Expenses = ({expenses}) => {

    const[expenseYear, setExpenseYear] = useState();

    const expenseItem = (expenses) => {
        return expenses.map((expense) => <ExpenseItem title={expense.title} date={expense.date} amount={expense.amount} key={Math.random().toString()}/>)
    }

    const expenseFilterYear = expenseYearData => {
        setExpenseYear(expenseYearData)
        console.log(expense);
    }

    return (
        <div>
            <ExpensesFilter onExpenseFilterYear={expenseFilterYear}/>
        <Card className="expenses">
            {expenseItem(expenses)}
        </Card>

        </div>
       
    )
}

export default Expenses
